1- public void testConverter() throws Exception { String converterName = cs.getConverterName("application/pdf","text/plain"); assertEquals("pdf2text",converterName); checkConverterAvailability(converterName); checkCommandAvailability("pdftotext"); BlobHolder pdfBH = getBlobFromPath("test-docs/hello.pdf"); BlobHolder result = cs.convert(converterName,pdfBH,null); if (result == null) { assertNotNull(result); } List<Blob> blobs = result.getBlobs(); if (blobs == null) { assertNotNull(blobs); } assertEquals(1,blobs.size()); Blob blob = result.getBlob(); if (blob == null) { assertNotNull(blob); } assertEquals("text/plain",blob.getMimeType()); assertTrue(blob.getLength() > 0); String newline = System.getProperty("line.separator"); assertEquals("Hello from a PDF Document!" + newline + newline + newline,blob.getString()); }
